pragma solidity ^0.8.0;
import "./ownable.sol";
import "./SafeMath.sol";


contract EternalHouseFactory is Ownable{

using SafeMath for uint256;



    struct slot{
        string description;
        string imgUrl;
        uint256 id; 
        uint256 size; // 0 - xs , 1 - s, 2 - m, 3 - l, 4-xl, 5 -ul ..
        uint256 changed;
        uint256 house;
        uint256 room;
    }



// allotment for sizes
// [0] = xs, [1] = s, [2] = m, [3] = l, [4] = xl, [5] == xxl, [6] == ultra, [7] == king
    uint256[] sizeAllotment = [160,200,300,200,100,100,28,2];

// num slots already created
// [0] = xs, [1] = s, [2] = m, [3] = l, [4] = xl, [5] == xxl, [6] == ultra, [7] == king
    uint256[] sizeCreated = [0,0,0,0,0,0,0,0];



// fees to mint each slot 
// [0] = xs, [1] = s, [2] = m, [3] = l, [4] = xl, [5] == xxl, [6] == ultra, [7] == king
    uint256[] sizeFees = [.03 ether, .05 ether, .08 ether, .11 ether, .17 ether, .20 ether, .25 ether,.30 ether];
    uint256[][] house_matrix = [
        [uint256(1),uint256(160)],
        [uint256(161),uint256(304)],
        [uint256(305),uint256(430)],
        [uint256(431),uint256(545)],
        [uint256(546),uint256(660)],
        [uint256(661),uint256(755)],
        [uint256(756),uint256(850)],
        [uint256(851),uint256(923)],
        [uint256(924),uint256(986)],
        [uint256(987),uint256(1041)],
        [uint256(1042),uint256(1090)]
    ];



    slot[1090] slots;





    uint256 initialFreezeTimeStamp;
    uint256 hibernationTimePeriod;
    uint256 saleTimePeriod;

    event NewSlot(uint256 id, string description,string imgUrl, uint256 size, uint256 house, uint256 room);
    event UpdatedSlot(uint256 id, string description,string imgUrl);
    event UpdatedFreezeStamp(bool set);
    event UpdatedHibernationPeriod(bool set);
    event UpdatedSalePeriod(bool set);

    mapping(uint256 => address) public slotToOwner;
    mapping (address => uint256) ownerSlotCount;

    // require that address is owner of the slot
    modifier onlyOwnerOf(uint256 id) {
    require(msg.sender == slotToOwner[id]);
    _;
  }

    // only owner can withdraw money deposited in the contract
      function withdraw() external onlyOwner returns(bool){
        address payable _owner = payable(msg.sender);
        _owner.transfer(address(this).balance);
        return true;
    }


    // require that address is owner of the slot
    modifier canMint(uint256 _size) {
            require(sizeCreated[_size] < sizeAllotment[_size], "All slots for that this size been minted");
    _;
  }




    /// @return an id for the slot
    function _createID(uint256 _size) internal view returns(uint256){
        if(_size == 0){ // xs
            return sizeCreated[0];
        } 
        uint256 _id = 0;
        for(uint256 i = 0; i < _size; i++){
            _id = _id + sizeAllotment[i];
        }
        _id = _id + sizeCreated[_size];
        return _id;

    }

     /// @dev update the number of slots created for a given size
    function _updateCreationCount(uint256 _size) internal{
        sizeCreated[_size] = sizeCreated[_size] + 1;

    }

    /* 
        Slots are created based on array indexes 
        _descriptionArr[0], _imgUrlArr[0], _sizeArr[0] maps to one slot
        _descriptionArr[1], _imgUrlArr[1], _sizeArr[1] maps to another slot... and so on
        Check if enough ether to mint all slots. Arrays must be same length. Can't mint more than 20 at time
    */
    /// @dev create slot(s) in one of the houses 
    /// @param _descriptionArr - array containing all of the descriptions of slots to mint
     /// @param _imgUrlArr - array containing all of the img urls of slots to mint
      /// @param _sizeArr - array containing all of the sizes of slots to mint
    function createSlot(string[] memory _descriptionArr, string[] memory _imgUrlArr, uint256[] memory _sizeArr) public payable {
        require(_enoughEther(_sizeArr) == true,"Fee entered is not fee for the slot");
        require(_descriptionArr.length == _imgUrlArr.length, "Cannot mint. Arrays are different lengths");
        require(_imgUrlArr.length == _sizeArr.length, "Cannot mint. Arrays are different lengths");
        require(_descriptionArr.length > 0 , "No data sent in");
        require(_descriptionArr.length <= 20 , "Trying to mint too much");
         for(uint256 i = 0; i < _descriptionArr.length; i++){
             string memory _description = _descriptionArr[i];
             string memory _imgUrl = _imgUrlArr[i];
             uint256 _size = _sizeArr[i];
            _createSlot(_description, _imgUrl, _size);
        }

    }

    /// @dev makes sure there was enough ether sent to contract for the sizes that need to be minted
    /// @param _sizeArr - array containing all of the descriptions of slots to mint
    /// @return boolean -- was there enough ether? 
    function _enoughEther(uint256[] memory _sizeArr) internal returns(bool){
        uint256 needed = 0 ether;
        for(uint256 i = 0; i < _sizeArr.length; i++){
            needed = needed + sizeFees[_sizeArr[i]];
        }
        return msg.value >= needed;
    }

    function _getRoom(uint256 _id) internal returns(uint256){
        uint256[2][24] memory _idsRoomOne = [
            [uint256(1),uint256(28)], [uint256(161),uint256(182)], [uint256(285),uint256(288)], [uint256(300),uint256(304)],
            [uint256(305),uint256(335)], [uint256(431),uint256(448)], [uint256(529),uint256(532)], [uint256(542),uint256(545)], 
            [uint256(546),uint256(563)], [uint256(644),uint256(647)], [uint256(657),uint256(660)], [uint256(661),uint256(674)], 
            [uint256(740),uint256(743)], [uint256(752),uint256(755)], [uint256(756),uint256(769)], [uint256(835),uint256(838)], 
            [uint256(847),uint256(850)], [uint256(851),uint256(866)], [uint256(917),uint256(918)], [uint256(924),uint256(935)], 
            [uint256(936),uint256(939)], [uint256(987),uint256(994)], [uint256(1035),uint256(1036)], [uint256(1042),uint256(1052)]
        ];

        uint256[2][30] memory _idsRoomTwo = [
            [uint256(29),uint256(50)], [uint256(89),uint256(106)], [uint256(137),uint256(144)], [uint256(183),uint256(194)],
            [uint256(195),uint256(202)], [uint256(233),uint256(246)], [uint256(273),uint256(278)], [uint256(336),uint256(366)], 
            [uint256(413),uint256(416)], [uint256(449),uint256(464)], [uint256(489),uint256(499)], [uint256(521),uint256(524)], 
            [uint256(564),uint256(579)], [uint256(604),uint256(614)], [uint256(636),uint256(639)], [uint256(675),uint256(686)], 
            [uint256(706),uint256(714)], [uint256(732),uint256(735)], [uint256(770),uint256(781)], [uint256(801),uint256(809)], 
            [uint256(827),uint256(830)], [uint256(867),uint256(876)], [uint256(893),uint256(899)],[uint256(913),uint256(914)],
            [uint256(940),uint256(958)],[uint256(995),uint256(1002)], [uint256(1014),uint256(1019)], [uint256(1031),uint256(1032)],
            [uint256(1053),uint256(1065)], [uint256(1083),uint256(1084)]
        ];

         uint256[2][32] memory _idsRoomThree = [
            [uint256(51),uint256(60)], [uint256(107),uint256(136)], [uint256(145),uint256(152)], [uint256(203),uint256(210)],
            [uint256(247),uint256(272)], [uint256(279),uint256(284)], [uint256(367),uint256(372)], [uint256(391),uint256(412)], 
            [uint256(417),uint256(420)], [uint256(465),uint256(470)], [uint256(500),uint256(520)], [uint256(525),uint256(528)], 
            [uint256(580),uint256(585)], [uint256(615),uint256(635)], [uint256(640),uint256(643)], [uint256(687),uint256(691)], 
            [uint256(715),uint256(731)], [uint256(736),uint256(739)], [uint256(782),uint256(786)], [uint256(810),uint256(826)], 
            [uint256(831),uint256(834)], [uint256(877),uint256(880)], [uint256(900),uint256(912)],  [uint256(915),uint256(916)],
            [uint256(959),uint256(963)],[uint256(972),uint256(982)], [uint256(1003),uint256(1005)],[uint256(1020),uint256(1030)],
            [uint256(1033),uint256(1034)], [uint256(1066),uint256(1072)], [uint256(1079),uint256(1082)], [uint256(1085),uint256(1086)]
        ];

        uint256[2][26] memory _idsRoomFour = [
            [uint256(61),uint256(88)], [uint256(153),uint256(160)], [uint256(211),uint256(232)], [uint256(289),uint256(299)],
            [uint256(373),uint256(390)], [uint256(421),uint256(430)], [uint256(471),uint256(488)], [uint256(533),uint256(541)], 
            [uint256(586),uint256(603)], [uint256(648),uint256(656)], [uint256(692),uint256(705)], [uint256(744),uint256(751)], 
            [uint256(580),uint256(585)], [uint256(615),uint256(635)], [uint256(640),uint256(643)], [uint256(687),uint256(691)], 
            [uint256(787),uint256(800)], [uint256(839),uint256(846)], [uint256(881),uint256(892)], [uint256(919),uint256(923)], 
            [uint256(964),uint256(971)], [uint256(983),uint256(986)], [uint256(1006),uint256(1013)],[uint256(1037),uint256(1041)],
            [uint256(1073),uint256(1078)], [uint256(1087),uint256(1090)]
        ];

        uint256 _idOffset = _id + 1; 
        for(uint256 i = 0; i < _idsRoomOne.length; i++){
            uint256[2] memory tuple = _idsRoomOne[i];
            if(_idOffset >= tuple[0] && _idOffset <= tuple[1]){
                return 1;
            }
            if(_idOffset < tuple[0]){ // no need to keep searching. not in this room
                break;
            }

        }

        for(uint256 i = 0; i < _idsRoomTwo.length; i++){
            uint256[2] memory tuple = _idsRoomTwo[i];
            if(_idOffset >= tuple[0] && _idOffset <= tuple[1]){
                return 2;
            }
            if(_idOffset < tuple[0]){ // no need to keep searching. not in this room
                break;
            }

        }

        for(uint256 i = 0; i < _idsRoomThree.length; i++){
            uint256[2] memory tuple = _idsRoomThree[i];
            if(_idOffset >= tuple[0] && _idOffset <= tuple[1]){
                return 3;
            }
            if(_idOffset < tuple[0]){ // no need to keep searching. not in this room
                break;
            }

        }

        for(uint256 i = 0; i < _idsRoomFour.length; i++){
            uint256[2] memory tuple = _idsRoomFour[i];
            if(_idOffset >= tuple[0] && _idOffset <= tuple[1]){
                return 4;
            }
            if(_idOffset < tuple[0]){ // no need to keep searching. not in this room
                break;
            }

        }
    }

    function _getHouse(uint256 id) internal view returns(uint256){
        uint256 _idOffset = id + 1; 
        uint256 num_houses = 11;
        for(uint256 i = 0; i < num_houses; i++){
            uint256[] memory start_end = house_matrix[i];
            if(_idOffset >= start_end[0] && _idOffset <= start_end[1]){
                return i + 1;
            }
        }
    }


    /// initializes a slot in the Infinity Collections
    /// @dev check if more slots can minted, 
    /// @param _description - the description of the slot 
    /// @param _imgUrl - the imgURL associated with the slot
    /// @param _size -- the slot's size 
    function _createSlot(string memory _description, string memory _imgUrl, uint256 _size) internal canMint(_size){
        uint256 id = _createID(_size);
        uint256 house = _getHouse(id);
        uint256 room = _getRoom(id);
        slot memory purchased = slot(_description, _imgUrl,id, _size,1,house, room); // new slot
        slots[id] = purchased;
        slotToOwner[id] = msg.sender; // attach slot to owner
        ownerSlotCount[msg.sender]++; // add slot to the owner count
        _updateCreationCount(_size);
        emit NewSlot(id, _description, _imgUrl, _size, house,room);
    }

    /// @return address of slot's owner
    function _getOwner(uint256 id) public view returns(address){
        return slotToOwner[id];
    }

    /// change information associated with a slot
    function changeSlotInfo(uint256 id, string memory _description, string memory _imgUrl) public {
        _changeSlotInfo(id, _description, _imgUrl);
    }

    /// @dev -- makes sure that person hasn't edited slot more than twice
    /// @param id -- associated with slot
    /// @param _description -- slot's description to change to
    /// @param _imgUrl -- slot's new imgUrl
    function _changeSlotInfo(uint256 id, string memory _description, string memory _imgUrl) internal onlyOwnerOf(id){
        require(_isReady() == true, "Hibernation Period In Effect");
        slot storage mySlot = slots[id]; 
        require(mySlot.changed < 2, "Reached maximum number of edits");
        mySlot.description = _description;
        mySlot.imgUrl = _imgUrl;
        mySlot.changed++;
        emit UpdatedSlot(id, _description, _imgUrl);
    }

    /// @dev -- restore slot after sold then trigger freeze if sold more than 5 times
    /// @param _mySlot -- slot to restore

    function _restoreSlotChanged(slot storage _mySlot) internal{ // come back and fix name
        _mySlot.changed = 1;
    }

    function _canTransfer() internal view returns(bool){
        bool hibernating = true;
        bool notFound = true;
        uint256 interval = initialFreezeTimeStamp;
        while(notFound){
            interval += hibernationTimePeriod;
            hibernating = true;
            if(block.timestamp <= interval){
                notFound = false;
                break;
            }
            hibernating = false;
            interval += saleTimePeriod;
            if(block.timestamp <= interval){
                notFound = false;
                break;
            }
        }
        if(hibernating == false) return true;
        return false;
    }

    // @return boolean -- is the slot able to be sold ?
     function _isReady() internal  view returns (bool) {
         if(initialFreezeTimeStamp == 0 || hibernationTimePeriod == 0 || saleTimePeriod == 0) return true;
         if(initialFreezeTimeStamp != 0 && block.timestamp < initialFreezeTimeStamp) return true;
         if(_canTransfer() == true) return true;
         return false;
  }

  function setInitialFreezeTimeStamp(uint256 _freezeTimeStamp) external onlyOwner{
        initialFreezeTimeStamp  = _freezeTimeStamp;
        emit UpdatedFreezeStamp(true);
  }

  function setHibernationTimePeriod(uint256 _hibernationTimePeriod) external onlyOwner{
        hibernationTimePeriod  = 365 days * (_hibernationTimePeriod);
         emit UpdatedHibernationPeriod(true);
  }

   function setSaleTimePeriod(uint256 _saleTimePeriod) external onlyOwner{
        saleTimePeriod  = 365 days * (_saleTimePeriod);
         emit UpdatedSalePeriod(true);
  }



}

